import React from "react";
import { Form, Breadcrumb,Icon, } from 'antd';

import { Redirect } from 'react-router';
import { BrowserRouter as Router,Route, Switch,Link } from "react-router-dom";
import {MDBFooter} from 'mdbreact';


import geo from "./geo";
import grid from "./grid";
import product from "./product";

class pi1 extends React.Component {
    state = {
      confirmDirty: false,
      autoCompleteResult: [],
      redirect: false,
    };
  
   
render() {
  
  return (
<div>
<Router>
  <div className="flyout" style={{backgroundColor:"#fff"}}>
    <div style={{ marginTop: "3.5rem" }}>
    <Breadcrumb>
      <Breadcrumb.Item >
        <Icon type="user" />
        <Link to="/pi">Profile</Link>
      </Breadcrumb.Item>

      <Breadcrumb.Item >
        <Icon type="user" />
        <Link to="/geo">Shop</Link>
      </Breadcrumb.Item>

      <Breadcrumb.Item >
        <Icon type="user" />
        <Link to="/product">Product</Link>
      </Breadcrumb.Item>

  </Breadcrumb>
        <Switch>
        
        <Route exact path ="/pi"component={grid}/>
        <Route exact path ="/geo"component={geo}/>
        <Route exact path ="/product"component={product}/>
        <Route
          render={function () {
            return <h1>Not Found</h1>;
          }}
        />
      </Switch>
          </div>
          <MDBFooter color="" style={{backgroundColor:"#213357",zIndex: "",}}>
            <p className="footer-copyright mb-0 py-3 text-center">
              &copy; {new Date().getFullYear()} Copyright:{" "}
              <a href="https://www.MDBootstrap.com"> cladi.com </a>
            </p>
          </MDBFooter>
        </div>
      </Router>
</div>
       );
            }}

const pi = Form.create({ name: 'time_related_controls' })(pi1);
export default pi;
